    "terms_section1": MessageLookupByLibrary.simpleMessage(
      "باستخدام تطبيق Building Knowledge (بما في ذلك جميع خصائصه - سواء كانت للهاتف المحمول أو غير ذلك - المملوكة والمدارة من قبل Building Knowledge)، والبيانات والخدمات ذات الصلة (المشار إليها مجتمعة باسم \'الخدمات\')، فإنك توافق على الالتزام بشروط الاستخدام التالية، والتي قد يتم تحديثها من وقت لآخر.",
    ),
    "terms_section10": MessageLookupByLibrary.simpleMessage(
      "التغييرات؛ التوقف عن الخدمة\nيجوز لـ Building Knowledge تعديل هذه الشروط في أي وقت. تكون التغييرات سارية فور نشرها. يشكل استمرار استخدامك للخدمات قبولًا لهذه التغييرات. كما يجوز لـ Building Knowledge تعديل أو تعليق أو إيقاف الخدمات دون إشعار مسبق.",
    ),
    "terms_section11": MessageLookupByLibrary.simpleMessage(
      "اختيار القانون؛ النزاعات\nتخضع هذه الشروط لقوانين جمهورية مصر العربية. يجب حل أي نزاعات في المحاكم الواقعة في القاهرة، مصر. يحق للطرف الفائز في أي نزاع استرداد أتعاب المحاماة والتكاليف القانونية.",
    ),
    "terms_section12": MessageLookupByLibrary.simpleMessage(
      "التعويض\nتوافق على الدفاع عن Building Knowledge وتعويضه وحمايته من أي مطالبات ناتجة عن انتهاكك لهذه الشروط أو استخدامك للخدمات أو انتهاك القوانين أو المواد التي تقدمها عبر حسابك.",
