    ),
    "terms_section15": MessageLookupByLibrary.simpleMessage(
      "لأي استفسارات أو طلبات بخصوص معلوماتك، يُرجى التواصل مع Building Knowledge عبر البريد الإلكتروني: info@buildingknowledge.com.",
    ),
    "terms_section2": MessageLookupByLibrary.simpleMessage(
      "الاستخدام المسموح به\nما لم تكن محترفًا في العقارات أو القروض المالية وتتصرف بصفتك المهنية، فإنك توافق على استخدام الخدمات لأغراض شخصية فقط. يقتصر الاستخدام التجاري على المعاملات التي تتم لحسابك الشخصي فقط. يجوز لمحترفي العقارات أو القروض استخدام الخدمات لتقديم المعلومات للعملاء أو اتخاذ إجراءات نيابة عنهم (مثل إدراج عقار للبيع). ومع ذلك، يُحظر على محترفي القروض استخدام معلومات Building Knowledge لاتخاذ قرارات متعلقة بالقروض.",
    ),
    "terms_section3": MessageLookupByLibrary.simpleMessage(
      "١. الاستخدام المقبول\nتوافق على عدم استخدام الخدمات بطريقة غير قانونية أو بطريقة تضر بـ Building Knowledge أو مزودي الخدمة أو الموردين أو المستخدمين الآخرين. تشمل الأنشطة المحظورة توزيع البريد العشوائي، والرسائل المتسلسلة، والمخططات الهرمية، أو أي اتصالات مماثلة. لا يجوز لك انتحال شخصية شخص آخر أو تقديم معلومات زائفة حول علاقتك بكيان معين.",
    ),
    "terms_section4": MessageLookupByLibrary.simpleMessage(
      "٢. الاستعلامات التلقائية\nيُحظر إرسال استعلامات تلقائية (مثل سحب البيانات، العناكب، الروبوتات، برامج الزحف) ما لم تحصل على إذن كتابي من Building Knowledge. يُسمح لمحركات البحث العامة بفهرسة الخدمات فقط في الحدود التي يسمح بها قانون حقوق النشر المعمول به، ولا يجوز لها تجاوز أنظمة الأمان مثل CAPTCHA.",
    ),
    "terms_section5": MessageLookupByLibrary.simpleMessage(
      "المواد التي تقدمها؛ استخدام الحساب؛ الخصوصية\nعند تقديم أي مواد إلى Building Knowledge، فإنك تمنح ترخيصًا غير قابل للإلغاء، ودائمًا، وخاليًا من حقوق الملكية في جميع أنحاء العالم لاستخدام ونسخ وتوزيع وعرض وتعديل وترجمة المواد الخاصة بك فيما يتعلق بالخدمات أو وسائل الإعلام الأخرى. يجوز لـ Building Knowledge إزالة أو تعديل أي مادة مقدمة من طرفك في أي وقت.",
    ),
    "terms_section6": MessageLookupByLibrary.simpleMessage(
      "تحديث أو تصحيح المعلومات\nتعتمد قدرتك على تحديث أو تصحيح المعلومات على علاقتك بـ Building Knowledge. يمكن للعملاء طلب تحديث أو تصحيح أو حذف المعلومات الشخصية من خلال التواصل مع Building Knowledge. ومع ذلك، قد تبقى بعض المعلومات في أنظمة النسخ الاحتياطي ولا يمكن محوها بالكامل.",
    ),
    "terms_section7": MessageLookupByLibrary.simpleMessage(
      "دور Building Knowledge\nيُعد Building Knowledge وسيطًا عقاريًا مرخصًا في مصر.",
    ),
    "terms_section8": MessageLookupByLibrary.simpleMessage(
      "الملكية الفكرية\nتعد الخدمات ملكية خاصة بـ Building Knowledge. لا يجوز لك استخدام العلامات التجارية لـ Building Knowledge كجزء من اسم المستخدم أو عنوان البريد الإلكتروني الخاص بك. لا يدعي Building Knowledge حقوق الطبع والنشر للصور أو الأوصاف المدرجة، حيث يخضع استخدامها لموافقة مالك حقوق الطبع والنشر والقوانين المعمول بها.",
    ),
    "terms_section9": MessageLookupByLibrary.simpleMessage(
      "تحديد المسؤولية؛ العلاج الحصري\nلا يتحمل Building Knowledge أو الموردون المسؤولية عن أي أضرار غير مباشرة أو تبعية أو خاصة أو عرضية أو عقابية ناشئة عن استخدامك للخدمات. العلاج الوحيد المتاح لك إذا كنت غير راضٍ عن هذه الشروط هو التوقف عن استخدام الخدمات.",
